import React from 'react';
import AvatarImage from './AvatarImage';
import HeroName from './HeroName';

export default function Avatar(props) {
  return (
    <div>
      <div>
        <AvatarImage
          user={props.user}
          size={props.avatarSize}
          a="1"
          b="2"
          c="3"
        />
      </div>

      <div>
        <HeroName name={props.user} />
      </div>
    </div>
  );
}
